import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter } from "react-router-dom";
import NavigationBar from "./components/NavigationBar";
function App() {
  return (
    <>
      <BrowserRouter>
        <div>
          <NavigationBar />
        </div>
      </BrowserRouter>
    </>
  );
}

export default App;
